  return _c('div', [_vm._ssrNode("<article data-v-2d556424><h3 data-v-2d556424>Why</h3><p data-v-2d556424>Awesomes.cn 成立的目的主要是为了给国内用户提供前端Github库的归档和中文文档，从而更好地学习前端知识。</p><p data-v-2d556424>Awesome的中文意思是：可怕的; 令人敬畏的; 使人畏惧的; 极好的; 加上中国的顶级域名 cn，就是为了告诉大家这里是国内前端资源的集合。</p><p data-v-2d556424>我们秉承开源共享的思想，让全国的前端工程师共同维护这个资源库，中文文档可以自由编辑（当然为了保证质量需要经过审核）Awesomes.cn 网站本身也开源在了 GitHub 上</p><p data-v-2d556424>Awesomes.cn是基于Ruby on Rails搭建的，服务器用的是阿里云的ECS，OSS云存储和RDS云数据库，最大限度地优化访问速度。</p><h3 data-v-2d556424>功能</h3><ul data-v-2d556424><li data-v-2d556424>同步 Github 前端库并做好分类</li><li data-v-2d556424>对同类的库进行 热度、时间和趋势的排序</li><li data-v-2d556424>趋势的排序规则是根据各个时间段Github的多个方面的数据计算分析得出，可大致预测未来的发展趋势</li><li data-v-2d556424>对每个库开放编辑文档，并对用户提交的文档做好版本控制，可查看到每个库的所有的提交历史</li><li data-v-2d556424>全站采用 markdown 编辑模式</li><li data-v-2d556424>对可用的数据开放了API接口，详见 API  </li></ul><p data-v-2d556424>在不失简洁的前提下，未来我们还将加入更多有趣和有用的功能，我们是一个注重用户体验的团队</p><p data-v-2d556424>如果你在访问的过程中哪里让你感觉到不爽，或者你有好的想法和建议，通过 微博 联系我们，我们真诚期待您的反馈！</p><h3 data-v-2d556424>Logo</h3><p data-v-2d556424>我们同时设计了圆形和正方形的Logo，分别支持 50px、100px、200px、500px 的尺寸</p><p data-v-2d556424>访问地址为：</p><p data-v-2d556424>圆形：</p><p data-v-2d556424>http://www.awesomes.cn/assets/logo-尺寸数字.png</p><p data-v-2d556424>方形：</p><p data-v-2d556424>http://www.awesomes.cn/assets/logo-square-尺寸数字.png</p><p data-v-2d556424>比如</p><img src=\"https://www.awesomes.cn/assets/logo-100.png\" data-v-2d556424><p data-v-2d556424>http://www.awesomes.cn/assets/logo-100.png</p><img src=\"http://www.awesomes.cn/assets/logo-square-100.png\" data-v-2d556424><p data-v-2d556424>http://www.awesomes.cn/assets/logo-square-100.png</p></article>")])
