      }
      if (/^http(s)?:\/\//.test(name)) {
        return name
      }
      let url = `https://awesomes.oss-cn-beijing.aliyuncs.com/${folder}/${name}`
      if (process) {
        url += `?x-oss-process=style/${process}`
      }
      return url
    }

    // 弹出登录框
    Vue.prototype.showLogin = function () {
